function SumImportes(n){n.value==""&&$("#"+n.id).val("0");$("#TotalExSocios").text("Calculando...");var t=0;return $("[id^= 'Importe_']").each(function(n,i){var r=$("#"+i.id).val();t=t+parseInt(r)}),$("#TotalExSocios").text(moneda+t.toLocaleString()),t}function GuardarRetenciones(){var n={ExSocios:GetDataExSociosImporte(),Modo:$("#Modo").val()};$.post("/RRHH/GuardarRetenciones",{crvm:n}).done(function(n){n.isEverythingGood==!0&&(CargarMenu(),CargarEstadoProceso())}).always(function(){CargarAlertas(frmHome)})}function ObjPersona(){return{IdPersona:null,Importe:null}}function GetDataExSociosImporte(){var n=[];return $("#RetencionesTable tbody tr[data-type='ExSocio']").each(function(t,i){var r=ObjPersona();r.IdPersona=i.id;r.Importe=$("#Importe_"+i.id).val();n.push(r)}),n}